import React from "react"
import GridContainer from "./GridContainer"
import SmartTitle from "./SmartTitle"

function AboutFirstPart(){
    return(
        <div className="about-first-part">
            <GridContainer h3="LEADING THE EVOLUTION IN" h1a="DRONE " h1b="FOOTAGE" buttonText="VIEW GALLERY"/>

            <SmartTitle h3Title="LEADING THE EVOLUTION IN" h1TitleA="DRON" h1TitleB="FOOTAGE"/>
            <div className="black-gradient-bottom"></div>
        </div>

    )
}

export default AboutFirstPart
